import { Layout, Typography, Row, Col, Statistic, Button, Card } from "antd";
import React, { useState, useEffect } from 'react';
import { Column } from '@ant-design/charts';
const { Title } = Typography;
const { Content } = Layout;

const TrangChu = () => {
    var data = [
        {
          name: 'Đơn hàng',
          月份: 'Jan.',
          月均降雨量: 18.9,
        },
        {
          name: 'Đơn hàng',
          月份: 'Feb.',
          月均降雨量: 28.8,
        },
        {
          name: 'Đơn hàng',
          月份: 'Mar.',
          月均降雨量: 39.3,
        },
        {
          name: 'London',
          月份: 'Apr.',
          月均降雨量: 81.4,
        },
        {
          name: 'London',
          月份: 'May',
          月均降雨量: 47,
        },
        {
          name: 'London',
          月份: 'Jun.',
          月均降雨量: 20.3,
        },
        {
          name: 'London',
          月份: 'Jul.',
          月均降雨量: 24,
        },
        {
          name: 'London',
          月份: 'Aug.',
          月均降雨量: 35.6,
        },
        {
          name: 'Berlin',
          月份: 'Jan.',
          月均降雨量: 12.4,
        },
        {
          name: 'Berlin',
          月份: 'Feb.',
          月均降雨量: 23.2,
        },
        {
          name: 'Berlin',
          月份: 'Mar.',
          月均降雨量: 34.5,
        },
        {
          name: 'Berlin',
          月份: 'Apr.',
          月均降雨量: 99.7,
        },
        {
          name: 'Berlin',
          月份: 'May',
          月均降雨量: 52.6,
        },
        {
          name: 'Berlin',
          月份: 'Jun.',
          月均降雨量: 35.5,
        },
        {
          name: 'Berlin',
          月份: 'Jul.',
          月均降雨量: 37.4,
        },
        {
          name: 'Berlin',
          月份: 'Aug.',
          月均降雨量: 42.4,
        },
    ]
    var config = {
      data: data,
      isGroup: true,
      xField: 'Đơn hàng',
      yField: '月均降雨量',
      seriesField: 'name',
      dodgePadding: 2,
      label: {
        position: 'middle',
        layout: [
          { type: 'interval-adjust-position' },
          { type: 'interval-hide-overlap' },
          { type: 'adjust-color' },
        ],
      },
    };
  return (
    <Layout>
      <Content>
        <div>
          <Title level={2}>Trang Chủ</Title>
        </div>

        <Row>
          <Col span="9">
            <Row>
              <Card title="Tổng đơn hàng" style={{ width: 700 }} extra={0}>
                <Row gutter={16}>
                  <Col span={12}>
                    <Statistic
                      title="Chờ nhận hàng"
                      value={112893}
                      valueStyle={{ color: "#017fff" }}
                    />
                  </Col>
                  <Col span={12}>
                    <Statistic
                      title="Chờ xác nhận"
                      value={112893}
                      valueStyle={{ color: "#017fff" }}
                    />
                  </Col>
                </Row>
              </Card>
            </Row>
            <br />
            <Row>
              <Card title="Sản phẩm đang bán" style={{ width: 700 }} extra={0}>
                <Row gutter={16}>
                  <Col span={12}>
                    <Statistic
                      title="Sản phẩm đang bán"
                      value={112893}
                      valueStyle={{ color: "#017fff" }}
                    />
                  </Col>
                  <Col span={12}>
                    <Statistic
                      title="Sản phẩm hết tồn"
                      value={112893}
                      valueStyle={{ color: "#017fff" }}
                      tooltip="Sản phẩm không còn trong kho"
                    />
                  </Col>
                </Row>
                <Row gutter={16}>
                  <Col span={12}>
                    <Statistic
                      title="Sản phẩm bị từ chối"
                      value={112893}
                      valueStyle={{ color: "#017fff" }}
                      tooltip="Sản phẩm không bị hủy"
                    />
                  </Col>
                  <Col span={12}>
                    <Statistic
                      title="Sản phẩm bị tắt"
                      value={112893}
                      valueStyle={{ color: "#017fff" }}
                      tooltip="Sản phẩm không được trưng bày"
                    />
                  </Col>
                </Row>
              </Card>
            </Row>
          </Col>
          <Col span="14">
            <Card title="Hiệu quả hoạt động" style={{ width: 800 }}  extra={<a href="#">Xem chi tiết</a>}>
            <Column {...config} />
            </Card>
          </Col>
        </Row>
      </Content>
    </Layout>
  );
};
export default TrangChu;
